import React, { useState } from "react";

function Effect() {
    const [name,setname]=useState(0)
  return (
    <>
      <h1>hello {name}</h1>
      <button onClick={()=>{
          setname(name+1);
      },()=>{alert('i am clicked')}}></button>
    </>
  );
}

export default Effect;
